import React from "react";
import "./apply.css";
import "./MarketingDep.css";
import MarketingDep from "./MarketingDep";
import { Link, Image } from "react-router-dom";


export default function MarketingForm(lang) {

    return (
        <div className="marketing-form">
            <Link to="https://youtu.be/_EzFndYdm_E">
                 <Image src="../images/events/lightbulb.jpg" className="imageLink" />
            </Link>
            <MarketingDep lang={lang} />
        </div>
    );
}
